import React, { Component } from "react";
import "../LoginStyle.scss";

export class Profiling extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>Hi ,</h1>
        <form>
          <label htmlFor="savingsList">Savings Account : </label>
          <input list="checkbox" id="ocbc">OCBC</input>

        </form>
      </div>
    );
  }
}
